void print_status(arm_status status, char* name){
	if(status != ARM_MATH_SUCCESS){
		switch(status){
			case ARM_MATH_ARGUMENT_ERROR :
					NRF_LOG_INFO("%s failure, Error = ARM_MATH_ARGUMENT_ERROR", name);
				break;
			case ARM_MATH_LENGTH_ERROR  :
					NRF_LOG_INFO("%s failure, Error = ARM_MATH_LENGTH_ERROR", name);
				break;
			case ARM_MATH_SIZE_MISMATCH  :
					NRF_LOG_INFO("%s failure, Error = ARM_MATH_SIZE_MISMATCH", name);
				break;
			case ARM_MATH_NANINF  :
					NRF_LOG_INFO("%s failure, Error = ARM_MATH_NANINF", name);
				break;
			case ARM_MATH_SINGULAR  :
					NRF_LOG_INFO("%s failure, Error = ARM_MATH_SINGULAR", name);
				break;
			case ARM_MATH_TEST_FAILURE  :
					NRF_LOG_INFO("%s failure, Error = ARM_MATH_TEST_FAILURE", name);
				break;
			default:
					NRF_LOG_INFO("%s failure, Error = Unknown", name);
		}
	}else{
		NRF_LOG_INFO("%s success", name);
	}
}

void relu(float32_t * input, int size){
	for(int i = 0; i < size; i++){
		if(input[i] <= 0){
			input[i] = (float32_t) 0.0;
		}
	}
}

void sigmoid(float32_t * input, float32_t * output, int size){
	
	for(int i = 0; i < size; i++){
		output[i] = 1.0f  / (1.0f + expf(-1.0f * input[i]));
	}
}

void multiply(float32_t * input1, float32_t * input2, float32_t * output, int size){
	for(int i = 0; i < size; i++){
		output[i] = input1[i] * input2[i];
	}
}

